import { Box, Typography } from '@mui/material';
import React from 'react';

const HomePage: React.FC = () => {
    return (
        <>
            <Box
              sx={{
                width: '100vw',
                height: '100px',
                justifyContent: 'center',
                border: '2px solid blue',
              }}
            >
              <Typography variant="h6" fontSize={"12px"}>
                Home Page
              </Typography>
            </Box>
            <Box>
                <p>Home page</p>
            </Box>
        </>
    );
}

export default HomePage;
